import React ,{ useState }from "react";
import "./app.css";
import Card from "./Card";
import Filter from "./Filter";


const App = () => {

  const [names, setName] = useState([
    {
      name: "Peter",
      Age: 31,
      addrress: "Alexandria",
      Phone: "000000",
      checked : false
    },
    {
      name: "John",
      Age: 21,
      addrress: "Alexandria",
      Phone: "000002",
      checked : false
    },
    {
      name: "Lara",
      Age: 1,
      addrress: "Alexandria",
      Phone: "0000003",
      checked : false
    },
  ]);


   const setNewCards = (cards) => {
    setName(cards);
   } 

  return (
    <div>
      <Filter/>
      <Card names={names} func={setNewCards}></Card>

    </div>
  );
};

export default App;
